import React from "react";
import { useParams } from "react-router-dom";

export const Profile: React.FC = () => {
  const { username } = useParams<{ username: string }>();

  console.log("Username from useParams:", username);

  return (
    <div class="flex items-center justify-center h-full">
  <div class="relative">
    <div class="absolute left-4 top-4 w-12 h-12 bg-gray-200 rounded-full"></div>
    <textarea class="w-full max-w-xl p-4 pl-16 text-sm text-gray-900 placeholder-gray-500 bg-white border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 dark:text-gray-100 dark:placeholder-gray-400 dark:bg-gray-800 dark:border-gray-700 dark:focus:ring-blue-600" rows="5" placeholder="Write your post here..."></textarea>
